-a-computer-virus.html','What Is A Computer Virus? - Norton','A computer virus, much like a flu virus, is designed to spread from host to host and has the ability to replicate itself. Similarly, in the same way that flu viruses cannot reproduce without a host cell, computer viruses cannot reproduce and spread without programming such as a file or document.','English'),(1151,39,11,'https://www.makeuseof.com/tag/types-computer-viruses-watch/','7 Types of Computer Viruses to Watch Out For and What They Do','4. Multipartite Virus. While some viruses are happy to spread via one method or deliver a single payload, multipartite viruses want it all. A virus of this type may spread in multiple ways, and it may take different actions on an infected computer depending on variables, such as the operating system installed or the existence of certain files.','English'),(1152,39,12,'https://us.norton.com/','Norton AntiVirus','Norton provides industry-leading antivirus and security software for your PC, Mac, and mobile devices. Download a NEW Norton 360 plan - protect your devices against viruses, ransomware, malware and other online threats.','English'),(1153,39,13,'https://www.youtube.com/watch?v=BMbGdyZiHWU','Most Dangerous Computer Viruses In The World - YouTube','Many of us at some point in time have had a computer start acting very strange; there are a lot of threats out there, and many come in the form of viruses. Computer viruses got their name because ...','English'),(1154,39,14,'https://searchsecurity.techtarget.com/definition/virus','What is a Computer Virus? - Definition from WhatIs.com','virus (computer virus): A computer virus is malicious code that replicates by copying itself to another program, computer boot sector or document and changes how a computer works. The virus ...','English'),(1155,39,15,'https://www.webopedia.com/TERM/V/virus.html','What is a Computer Virus? Webopedia Definition','A computer virus is a program or piece of code that is loaded onto your co