 the Ancient World, and the only one that remains largely intact today. Also known as the Pyramid of Khufu or the Pyramid of Cheops, it is believed construction on this pyramid spanned a 10- to 20-year ...','English'),(1188,40,18,'https://www.wonders-of-the-world.net/Seven/List-of-the-seven-wonders-of-the-modern-world.php','List of the Seven Wonders of the modern World','Although the seven wonders of the ancient world were listed definitively from antiquity on the basis of various lists previously established, the seven wonders of the modern world were designated following a vote organized by the New Seven Wonders Foundation, foundation created by the Swiss businessman Bernard Weber linked to a private marketing company.','English'),(1189,40,19,'https://ancientcivilizationsworld.com/seven-wonders/','Seven Wonders Of The Ancient World: Complete List and History','Seven Wonders of the ancient world  Mausoleum at Halicarnassus They attribute to his sister, and at the same time loved wife Artemisia, the construction of the tomb in honor of her brother. Apparently, Artemisia governed Halicarnassus for two years after he died and later, another brother named Idrieus finished the work.','English'),(1190,40,20,'https://www.ancienthistorylists.com/ancient-civilizations/7-wonders-of-the-ancient-world/','The 7 Wonders of the Ancient World - AncientHistoryLists','The seven wonders of the ancient world are examples of exceptional pieces of classical architecture and human achievement. The first list of the seven wonders dates back to the first or second century BC when it acted as a kind of guidebook for Hellenic sightseers. Compiled by ancient scholars, the list contains the most astounding centerpieces of great architecture and engineering and ...','English'),(1191,40,21,'https://www.amazon.com/Seven-Wonders-Ancient-World/dp/0415050367','Amazon.com: The Seven Wonders of the Ancient World ...','The Seven Wonders is a great book to introduce anyone to the wonders of the ancient 