https://www.bird-rescue.org/our-work/research-and-education/how-oil-affects-birds.aspx','How Oil Affects Birds - International Bird Rescue','When there is an oil spill, it\'s impossible to know in advance how many birds will be impacted. International Bird Rescue works with local state and federal biologists to look at what animals are in the area at the time of a spill and try to determine what species and how many of them may be exposed to oil.','English'),(1201,41,1,'https://www.thespruce.com/how-oil-affects-birds-386496','How Oil Spills Affects Birds - The Spruce','Massive oil spills often make headlines because of their destructive impact on wildlife and the environment. What many people don\'t realize, however, is that even a small amount of oil, no more than a dime-sized drop, can be deadly to birds.Understanding how oil affects birds can raise awareness of just how hazardous any oil spill or similar pollution can be.','English'),(1202,41,2,'https://en.wikipedia.org/wiki/List_of_natural_gas_and_oil_production_accidents_in_the_United_States','List of natural gas and oil production accidents in the ...','State had active oil and or gas wells as of April 2015 but no accidents have been uncovered.  Major crude oil train derailment in Mosier, a small town in the Columbia gorge spilled and burst into flames June 2016. The accident was due to railway dysfunction and bad parts.','English'),(1203,41,3,'https://www.nrdc.org/onearth/oils-spills-are-even-worse-birds-we-thought','Oil Spills Are Even Worse for Birds than We Thought | NRDC','Oil Spills Are Even Worse for Birds than We Thought ... surface had to expend approximately 20 percent more energy than birds flying oil-free. ... the safety of millions of peopleand their ...','English'),(1204,41,4,'https://www.mnn.com/earth-matters/wilderness-resources/stories/the-13-largest-oil-spills-in-history','The 13 largest oil spills in history | MNN - Mother Nature ...','More than 15,000 sea birds and enormous numbers of aquatic animals were killed before the spill was finally contained. ... The worst oil spill in history wasn\'t an accident  it was deliberate ...','English'),(1205,41,5,'https://en.wikipedia.org/wiki/Oilbird','Oilbird - Wikipedia','The oilbird (Steatornis caripensis), locally known as the gucharo, is a bird species found in the northern areas of South America including the island of Trinidad.It is the only species in the genus Steatornis and the family Steatornithidae.Nesting in colonies in caves, oilbirds are nocturnal feeders on the fruits of the oil palm and tropical laurels.','English'),(1206,41,6,'https://www.youngliving.com/blog/animals-and-oils-what-you-need-to-know/','Animals and essential oils: What you need to know','When we say that essential oils can be enjoyed by the whole family, that includes Bingo and Whiskers. There are just a few things that you need to keep in mind to make sure your fur (or scale, or wool, or feather, or hairless) babies stay safe and enjoy all the benefits YL oils have to offer.','English'),(1207,41,7,'https://birdsupplies.com/pages/parrot-safety-10-household-dangers-that-kill-parrots','Parrot Safety: 10 Household Dangers That Kill Parrots ...','Parrot Safety: 10 Household Dangers That Kill Parrots ... Hundreds of pet birds experience household accidents each year but you can take steps to protect your bird now. ... Pine oil cleaners Plant spikes and all fertilizer Plug-in air fresheners Potpourri oils','English'),(1208,41,8,'https://www.youtube.com/watch?v=1vuLggcLDLg','Dangers of Essential Oils: Top 10 Essential Oil Mistakes ...','But given how popular essential oils have become in recent years, and how many different brands of oils are now available, its not surprising that theres some growing concerns regarding ...','English'),(1209,41,9,'https://oshwiki.eu/wiki/Accidents_and_incidents','Accidents and incidents - OSHWiki','An accident at work can be defined in different ways depending of the context in which it is used. Often also