er','Crude Oil Transportation: A Timeline of Failure . The following timelines list significant crude by rail accidents in North America in 2013 and 2014, as well as relevant spills from barges, tankers and pipelines relevant to proposals for the Hudson Valley.','English'),(1215,41,15,'http://www.essentialbird.com/safe-use-of-eos.html','safe use essential oils - Natural Herbal Holistic Bird ...','Before using any of the essential oils mentioned in this list, we urge you to first determine the safety of the essential oil or blend for yourself. Bird species that have been diffused with some of the essential oils on this list include: finches, canaries, chickens, turkeys, crows, doves and parrots.','English'),(1216,41,16,'http://forums.avianavenue.com/index.php?threads/essential-oils.154368/','Essential oils | Avian Avenue Parrot Forum','I have no plans to use Tea tree oil but was just disappointed that it was known to be so toxic to birds as I really believe certain oils can be beneficial in people and animals. I will keep researching and always be very careful around Kai. Id love as much in put as I can get from those with actual experience with essential oils.','English'),(1217,41,17,'https://oilprice.com/Energy/Energy-General/The-10-Worst-Energy-Related-Disasters-In-History.html','The 10 Worst Energy-Related Disasters Of Modern Times ...','Wildlife in the surrounding area was severely impacted -- oil-covered dead birds, fish, and mammals washed ashore. The incident spurred action by the U.S. Congress, which passed the Oil Pollution ...','English'),(1218,41,18,'https://academy.allaboutbirds.org/what-oil-spills-do-to-birds/','What Oil Spills do to Birds | Bird Academy  The Cornell Lab','Birds were oiled as the result of the Deepwater Horizon oil spill. Species seen include American White Pelican, Brown Pelican, Snowy Egret, Sanderling, terns, and gulls. There was a huge effort underway at the time to capture these birds and bring them to rehabilitation experts for treatment.','English'),(1219,41,19,'https://ashleyhannah2.wordpress.com/2014/04/16/oil-and-birds/','10 Ways Oil Affects Birds | Peep-Lo','We all know that oil spills are bad for birds, but why exactly are oil spills bad for birds? And what other oil and natural gas related issues do birds have? In this post I will look at how oil affects birds physically and what species are affected by oil. Why is Oil on a','English'),(1220,41,20,'https://www.education.com/science-fair/article/effect-of-oil-on-birds/','What Effect Does Oil have on Birds? | Science project ...','When oil spills into waterways, birds that come in contact with the oil instantly lose their waterproofing and often do not survive without human help. Use this project to learn what makes a bird waterproof, how just a single drop of oil spilled into the environment damages a birds feather structure and other harmful effects of oil on birds.','English'),(1221,41,21,'https://www.nationalgeographic.org/activity/birds-feathers-and-oil/','Birds, Feathers, and Oil | National Geographic Society','Resource Library | Activity : 45 mins Birds, Feathers, and Oil Students are introduced to the 2010 Gulf of Mexico oil spill. Through a hands-on simulation, students explore how birds are affected by oil and how wildlife rescuers help oiled birds.','English'),(1222,41,22,'https://www.skybrary.aero/index.php/Accident_and_Serious_Incident_Reports:_Wildlife_Strike','Accident and Serious Incident Reports: Wildlife Strike ...','Definition. A selection of reports relating to accidents and serious incidents which involved a Wildlife Strike.. The accident and serious incident reports are grouped together below in subcategories based upon SKYbrary database tags.. Large Birds. A320, vicinity Auckland New Zealand, 2012 (On 20 June 2012, the right V2500 engine compressor of an Airbus A320 suddenly stalled on final approach.','English'),(1223,41,23,'https://www.popularmechanics.com/science/energy/g1765/biggest-oil-spills-in-history/','10