fields with varying ownership sharing a central processing facility (CPF). BP operates six of the seven ETAP fields; Machar, Madoes, Mirren, Mungo, Monan and Marnock.','English'),(1255,42,25,'https://decomnorthsea.com/','Decom North Sea','Decom North Sea is the single topic, multi region membership organisation which connects capability with opportunity across the oil and gas decommissioning sector. ... operators and supply chain together to create the co-operative environment required by the decommissioning industry.','English'),(1256,42,26,'https://www.bp.com/en/global/corporate/sustainability/safety/case-studies/responding-to-an-oil-spill-in-the-north-sea.html','Responding to an oil spill in the North Sea ...','We worked with relevant UK government agencies and the oil spill response co-operative, Oil Spill Response Limited, to assess the potential impact on the environment and to agree the best way to respond. In this case, it was by allowing the oil to disperse naturally at sea.','English'),(1257,42,27,'https://sciencing.com/list-7459738-environmental-impacts-oil-extraction.html','Environmental Impacts of Oil Extraction | Sciencing','Oil is a commodity in high demand. While most people would not argue about oil\'s importance, whether or not we should access and extract oil from below the earth\'s surface is a subject of frequent debate. Drilling for oil, both on land and at sea, can have a number of effects on the environment.','English'),(1258,42,28,'https://www.worldcat.org/title/north-sea-oil-and-the-environment-a-report-to-the-oil-development-council-for-scotland/oclc/21777894','North Sea oil and the environment : a report to the Oil ...','Get this from a library! North Sea oil and the environment : a report to the Oil Development Council for Scotland. [Scotland. Oil Development Council for Scotland. Committee on the Environment.;]','English'),(1259,42,29,'https://sedac.ciesin.columbia.edu/entri/texts/pollution.north.sea.by.oil.1969.html','Environmental Treaties and Resource Indicators (ENTRI ...','Agreement for Cooperation in Dealing with Pollution of the North Sea by Oil and Other Harmful Substances 13 September 1983. Summary of the \"Agreement for Cooperation in Dealing with Pollution of the North Sea by Oil\" is available from the UNEP Register of International Treaties and Other Agreements in the Field of the Environment.','English'),(1260,43,0,'https://www.reference.com/science/causes-damage-ozone-layer-95355f52a601550d','What Causes Damage to the Ozone Layer? | Reference.com','The ozone layer is being damaged by pollutants in the air that are mostly man-made, such as chlorine and bromine. The ozone damage occurs in the stratosphere and troposphere. The lower pollution in the troposphere has many of the same causes as the upper destruction, but causes more visible and health-related issues than the stratosphere damage.','English'),(1261,43,1,'https://www.nationalgeographic.com/environment/global-warming/ozone-depletion/','Ozone depletion facts and information - National Geographic','Over the past 30 years humans have made progress in stopping damage to the ozone layer by curbing the use of certain chemicals. But more remains to be done to protect and restore the atmospheric ...','English'),(1262,43,2,'https://sciencing.com/do-cfcs-damage-ozone-layer-5149840.html','How Do CFCs Damage the Ozone Layer? | Sciencing','How Do CFCs Damage the Ozone Layer? ... The ozone layer is about 300 to 500 DU thick on average, which is about the thickness of two stacked pennies. The Effect of CFCs. Scientists first began to realize the potential for chlorine to interact destructively with ozone in the early 1970s, and Sherwood Rowland and Mario Molina warned of the danger ...','English'),(1263,43,3,'https://www.epa.gov/ozone-layer-protection/basic-ozone-layer-science','Basic Ozone Layer Science | US EPA','The Earth\'s ozone layer ozone layerThe region of the stratosphere containing the bulk of atmospheric ozone. The ozone layer lies approximately 15-40 kilometers (10-25 miles) above the Earth\'s surface, in the stratosphere. Depletion of this layer by ozone depleting substances (ODS) will lead to higher UVB levels, which in turn will cause increased skin cancers and cataracts and potential damage ...','English'),(1264,43,4,'https://en.wikipedia.org/wiki/Ozone_depletion','Ozone depletion - Wikipedia','Consequences of ozone layer depletion. Since the ozone layer absorbs UVB ultraviolet light from the sun, ozone layer depletion increases surface UVB levels (all else equal), which could lead to damage, including increase in skin cancer. This was the reason for the Montreal Protocol.','English'),(1265,43,5,'https://en.wikipedia.org/wiki/Ozone_layer','Ozone layer - Wikipedia','Lay people were cautious about a depletion of the ozone layer and the risks of skin cancer. In 1978, the United States, Canada and Norway enacted bans on CFC-containing aerosol sprays that damage the ozone layer. The European Community rejected an analogous proposal to do the same.','English'),(1266,43,6,'https://www.conserve-energy-future.com/ozone-layer-and-causes-of-ozone-depletion.php','Ozone Layer and Causes, Effects and Solutions to Ozone ...','Natural causes of depletion of ozone layer: Ozone layer has been found to be affected by certain natural phenomena such as Sun-spots and stratospheric winds. But this has been found to cause not more than 1-2% depletion of the ozone layer and the effects are also thought to be only temporary.','English'),(1267,43,7,'https://www.quora.com/How-do-CFCs-damage-the-ozone-layer','How do CFCs damage the ozone layer? - Quora','This is a trick question! In layman\'s terms: Pollution from ground level all the way up to the highest levels of the atmosphere is neutralized by Ozone, which then turns back into pure oxygen. Where there is no Ozone, there is generally pollution,...','English'),(1268,43,8,'https://www.theguardian.com/environment/2018/nov/05/ozone-layer-healing-after-aerosols-un-northern-hemisphere','Ozone layer finally healing after damage caused by ...','The ozone layer is showing signs of continuing recovery from man-made damage and is likely to heal fully by 2060, new evidence shows. The measures taken to repair the damage will also have an ...','English'),(1269,43,9,'https://news.rpi.edu/content/2019/06/24/damage-ozone-layer-and-climate-change-forming-feedback-loop','Damage to the Ozone Layer and Climate Change Forming ...','Damage to the Ozone Layer and Climate Change Forming Feedback Loop New report finds that impacts of ozone-driven climate change span the ecosystem By Mary L. Martialay. Increased solar radiation penetrating through the damaged ozone layer is interacting with the changing climate, and the consequences are rippling through the Earths natural ...','English'),(1270,43,10,'https://www.epa.gov/ozone-layer-protection/health-and-environmental-effects-ozone-layer-depletion','Health and Environmental Effects of Ozone Layer Depletion ...','It is a cause of melanoma and other types of skin cancer. It has also been linked to damage to some materials, crops, and marine organisms. The ozone layer protects the Earth against most UVB coming from the sun. It is always important to protect oneself against UVB, even in the absence of ozone depletion, by wearing hats, sunglasses, and ...','English'),(1271,43,11,'https://www.eartheclipse.com/environment/causes-effects-solutions-of-ozone-layer-depletion.html','Causes, Effects and Solutions of Ozone Layer Depletion ...','The Ozone layer is a deep blanket in the stratosphere made up of comparatively high concentration of the ozone. As a result of its chemical composition, ozone is regarded as a special type of oxygen as it contains three oxygen molecules (O3) as opposed to the usual two oxygen molecules (O2).','English'),(1272,43,12,'https://sciencing.com/gases-affect-ozone-layer-5050.html','What Are the Gases That Affect the Ozone Layer? | Sciencing','The ozone layer is thin -- only about the thickness of two stacked pennies -- and certain gases interact with ozone to cause a seasonal thinning of the layer. Most of the gases responsible for these ozone holes are released as a result of human industrial or agricultural activity.','English'),(1273,43,13,'https://www.ucsusa.org/global-warming/science-and-impacts/science/ozone-hole-and-gw-faq.html','Is There a Connection Between the Ozone Hole and Global ...','Ozone (O 3) depletion does not cause global warming, but both of these environmental problems have a common cause: human activities that release pollutants into the atmosphere altering it. Global warming is caused primarily by putting too much carbon dioxide into the atmosphere when coal, oil, and ...','English'),(1274,43,14,'https://www.conserve-energy-future.com/causes-and-effects-of-ozone-hole.php','What is the Ozone Hole? - Conserve Energy Future','The effect of the ozone hole and the damage done to the layer is still not very well understood. Apart from the gradual decrease of the ozone layer all over the world, there is little quantifiable evidence of new holes appearing any time soon. Even so, a number of countries have been working towards mitigating the damage.','English'),(1275,43,15,'https://www.answers.com/Q/Which_chemical_damages_the_protective_ozone_layer','Which chemical damages the protective ozone layer ...','Ozone layer is very important in this world as it acts as a protective shield for the living organisms. It protects us from the harmful ultraviolet radiations of the sun which can cause some ...','English'),(1276,43,16,'https://www.answers.com/Q/What_damages_the_ozone_layer_the_most','What damages the ozone layer the most? - Answers.com','Ozone layer gets damages due to the use of ozone depleting substances.These ODS react with ozone and deplete it. What chemical damages the protective ozone layer?','English'),(1277,43,17,'https://www.smithsonianmag.com/science-nature/ozone-hole-was-super-scary-what-happened-it-180957775/','The Ozone Hole Was Super Scary, So What Happened To It ...','The Ozone Hole Was Super Scary, So What Happened To It? ... The ozone layer had been damaged more than scientists could have imagined before Farman discovered the hole. ... Ask Smithsonian: How ...','English'),(1278,43,18,'https://greentumble.com/what-affects-the-ozone-layer/','What Affects the Ozone Layer? | Greentumble','The ozone layer is a layer of ozone gas that is located in the stratosphere, approximately 6 to 10 miles (10-17 km) above the Earths surface, and is estimated to extend up approximately 30 miles (50 km). The ozone layer protects the Earth and all of its living creatures from the suns ultraviolet B (UVB) radiation.','English'),(1279,43,19,'http://www.environment.gov.au/protection/ozone/ozone-science/ozone-layer','Ozone and the ozone layer Australia','More about ozone layer depletion. The ozone layer is depleted in two ways. Firstly, the ozone layer in the mid-latitude (e.g. over Australia) is thinned, leading to more UV radiation reaching the earth. Data collected in the upper atmosphere have shown that there has been a general thinning of the ozone layer over most of the globe.','English'),(1280,43,20,'https://ecofriend.com/5-products-ozone-depletion.html','5 Products that cause ozone depletion and 5 alternatives ...','5 Products that cause ozone depletion. Though the list of ODS is not exhaustive, some commonly used products have been identified that have a substantial effect on the atmospheric ozone layer. Compiled by Dr Prem Jagyasi, here is a list of 5 most commonly used products that are detrimental for the health of ozone layer:','English'),(1281,43,21,'https://helpsavenature.com/ozone-layer-depletion-effects-causes','Causes and Effects of Ozone Layer Depletion That are ...','The ozone layer is responsible for absorbing harmful ultraviolet rays, and preventing them from entering the Earth\'s atmosphere. However, various factors have led to the depletion and damage of this protective layer. Learn more about the process, causes, and effects of ozone layer depletion.','English'),(1282,43,22,'https://www.nationalgeographic.org/encyclopedia/ozone-layer/','ozone layer | National Geographic Society','Ozone layer damage is more like a really thin patch than a hole. The ozone layer is thinnest near the poles. In the 1970s, people all over the world started realizing that the ozone layer was getting thinner and that this was a bad thing.','English'),(1283,43,23,'https://scied.ucar.edu/ozone-layer','The Ozone Layer | UCAR Center for Science Education','Near the ground, ozone is an air pollutant that causes lung damage and asthma attacks. But 10 to 30 miles above the Earths surface (16-48 km), ozone molecules protect life on Earth. They help shield our planet from harmful solar radiation. The ozone layer, in the stratosphere, is where about 90% of the ozone in the Earth system is found. But ...','English'),(1284,43,24,'https://www.reference.com/science/type-things-can-destroy-ozone-layer-4420661d4326014','What Type of Things Can Destroy the Ozone Layer ...','What Type of Things Can Destroy the Ozone Layer? ... Once it reaches the stratosphere, this destructive chemical reaction can continue to damage the earth\'s ozone for more than a hundred years. Along with contributing to ozone depletion, CFCs are also responsible for increasing the greenhouse gases that are present in the atmosphere. ...','English'),(1285,43,25,'https://www.airgo2.com/air-pollution/effects/ozone-layer-depletion/','Air pollution effects: Ozone Layer Depletion | AirGO','About 80% of the total ozone layer depletion is due to the production and emission of chlorofluorocarbons (CFCs). At stratospheric levels, CFCs convert into chlorine, which reacts with ultraviolet rays to destroy ozone on a massive scale. This conversion from CFCs to chlorine is faster at lower temperatures, and explains why the ozone layer above Antarctica has been extremely damaged.','English'),(1286,43,26,'https://qu