e version, and Mobile version, it is also possible to summon a Solar Eclipse using a Solar Tablet (legitimately obtainable only after defeating ...','English'),(1644,55,24,'https://www.nasa.gov/audience/forstudents/5-8/features/nasa-knows/what-is-an-eclipse-58/','What Is an Eclipse? | NASA','An eclipse takes place when Earth or the moon passes through a shadow of another heavenly body. An eclipse takes place when Earth or the moon passes through a shadow of another heavenly body. ...','English'),(1645,55,25,'https://simple.wikipedia.org/wiki/Solar_eclipse','Solar eclipse - Simple English Wikipedia, the free ...','As seen from Earth, a solar eclipse /ee-klips/ happens when the Moon is directly between the Earth and the Sun.This makes the Moon fully or partially (partly) cover the sun. Solar eclipses can only happen during a new moon.Every year about two solar eclipses occur.Sometimes there are even five solar eclipses in a year.','English'),(1646,55,26,'https://www.skyandtelescope.com/observing/solar-and-lunar-eclipses-in-2019/','Solar and Lunar Eclipses in 2019 - Sky & Telescope','A solar eclipse, such as the one in August 2017, occurs only at new Moon, when the lunar disk passes directly between us and the Sun and the Moon\'s shadow falls somewhere on Earth\'s surface.','English'),(1647,55,27,'http://mreclipse.com/Special/SEprimer.html','Solar Eclipses for Beginners','Annular Solar Eclipse and the Path of Annularity. Annular Solar Eclipses. Unfortunately, not every eclipse of the Sun is a total eclipse. Sometimes, the Moon is too small to cover the entire Sun\'s disk. To understand why, we need to talk about the Moon\'s orbit around Earth. That orbit is not perfectly round but is oval or elliptical in shape.','English'),(1648,55,28,'https://twitter.com/nasasun','NASA Sun & Space (@NASASun) | Twitter','The latest Tweets from NASA Sun & Space (@NASASun). We study the Sun and how it affects space around Earth and other worlds, producing key knowledge to protect astronauts, satellites and robotic missions. NASA Goddard, Greenbelt, MD','English'),(1649,55,29,'https://space-facts.com/solar-eclipse/','Solar Eclipse Facts - Total, Annular & Partial Solar Eclipses','Total Solar Eclipse. A total solar eclipse occurs when the Moon completely blocks the solar disk. In a total solar eclipse, the narrowest part of the path (where the Sun is completely blocked and the Moon casts its darkest shadow (called the umbra)) is called the zone of totality.','English'),(1650,56,0,'https://en.wikipedia.org/wiki/Doping_in_sport','Doping in sport - Wikipedia','Doping existed in other countries, says the expert Jean-Pierre de Mondenard, both communist and capitalist, but the difference with East Germany was that it was a state policy. The Sportvereinigung Dynamo (English:Dynamo Sports Club) was especially singled out as a center for doping in the former East Germany.','English'),(1651,56,1,'https://www.bbc.com/sport/athletics/33997246','Doping in sport: What is it and how is it being tackled ...','The issue of doping in sport has been widely discussed in recent weeks, but what exactly is it? BBC Sport explains what it means, why it has become a hot topic, what the types of doping are and ...','English'),(1652,56,2,'https://www.forbes.com/sites/roomykhan/2017/12/31/doping-in-sports-cheating-or-leveling-of-the-playing-field/','Doping In Sports - Cheating Or Leveling Of The Playing Field?','Forbes Daily Cover Stories ... Doping In Sports - Cheating Or Leveling Of The Playing Field? ... weightlifting, boxing, wrestling, ice hockey, rugby, and other sports, all have a track record of ...','English'),(1653,56,3,'http://www.theathlete.org/doping-in-sport.htm','Doping in sports - a deadly game - theathlete.org','Doping in Sports - A deadly Game \"The potential benefits to society and to the individual from sport will only be maximised where fair play is centre stage\" Council of Europe Introduction. Sport goes beyond a measure of athletic excellence and the winning of trophies and medals.','English'),(1654,56,4,'https://www.ncbi.nlm.nih.gov/pmc/articles/PMC2219897/','Doping in sports and its spread to at-risk populations: an ...','Doping became so prevalent in Olympic sport that some argued that all records should be discarded or put on hold until all forms of doping could be detected and stopped. Through the 1980s and 1990s, clandestine doping programs spread from sport to sport guided by modern, albeit unethical, pharmacists and sports medicine professionals.','English'),(1655,56,5,'https://www.medicalnewstoday.com/articles/305421.php','Doping in sports: is it worth it? - Medical News Today','Doping in sports is a big issue. What is it and what is being done to stop it? This spotlight looks at some of the issues, including gene doping and blood boosting.','English'),(1656,56,6,'https://en.wikipedia.org/wiki/List_of_doping_cases_in_sport','List of doping cases in sport - Wikipedia','The following is an incomplete list of sportspeople who have been involved in doping offences. It contains those who have been found to have, or have admitted to having, taken illegal performance-enhancing drugs, prohibited recreational drugs or have been suspended by a sports governing body for failure to submit to mandatory drug testing.','English'),(1657,56,7,'http://theconversation.com/how-to-argue-about-doping-in-sport-43600','How to argue about doping in sport - The Conversation','There has been a huge amount of academic, policy, and public debate over the years about doping in sport (i.e. the use of banned performance enhancing substances or drugs and other prohibited ...','English'),(1658,56,8,'https://www.bbc.com/sport/38884801','Doping in sport: Drug use \'fast becoming a crisis ...','Key stats from a ComRes/BBC doping in amateur sport poll Drug use at every level of sport is \"fast becoming a crisis\" according to UK Anti-Doping - responding to a BBC poll into doping in amateur ...','English'),(1659,56,9,'https://www.webmd.com/fitn