y due to the desire to be the first no matter what.','English'),(1674,56,24,'https://www.youtube.com/watch?v=4rUpX3QSPmw','What Do Performance-Enhancing Drugs Do To Your Body?','The Olympics are upon us, and unfortunately, many athletes use performance enhancing drugs to boost their ability. What exactly does doping and steroids do to your body? Watch More: Check out ...','English'),(1675,56,25,'https://www.verywellfit.com/epo-and-blood-doping-in-sports-3120522','Erythropoietin (EPO) in Blood Doping in Sports - Verywell Fit','Blood doping is in violation of standards set by the World Anti-Doping Agency (WADA) and is banned in professional sports. Even with rigorous testing among athletes, that hasn\'t stopped some from doing it anyway.','English'),(1676,56,26,'https://sportsanddrugs.procon.org/view.resource.php?resourceID=002352','Top 10 Pro & Con Arguments - Drug Use in Sports - ProCon.org','Furthernore, legalisation of doping, we believe, would encourage more sensible, informed use of drugs in amateur sport, leading to an overall decline in the rate of health problems associated with doping. Finally, by allowing medically supervised doping, the drugs used could be assessed for a clearer view of what is dangerous and what is not...','English'),(1677,56,27,'https://addictionresource.com/drugs-in-sports/','Drugs in Sports: Statistics, Side Effects, Prevention ...','On August 26th, 1960, doping in sports became an international topic when Knut Jensen died during the Olympic games in Rome. His death was linked to the use of amphetamines. In 1967, after a high-profile Tour de France doping death, the International Olympic Committee established a commission to fight doping in sports.','English'),(1678,56,28,'https://sportsanddrugs.procon.org/view.timeline.php?timelineID=000017','Historical Timeline - Drug Use in Sports - ProCon.org','\"The use of drugs to enhance performance in sports has certainly occurred since the time of the original Olympic Games [from 776 to 393 BC]. The origin of the word \'doping\' is attributed to the Dutch word \'doop,\' which is a viscous opium juice, the drug of choice of the ancient Greeks.\"','English'),(1679,56,29,'https://www.livescience.com/55779-biggest-doping-scandals-in-olympics-history.html','10 Biggest Doping Scandals in Olympics History | Live Science','Live Science is supported by its audience. When you purchase through links on our site, we may earn an affiliate commission. Learn more 10 Biggest Doping Scandals in Olympics History','English'),(1680,57,0,'https://en.wikipedia.org/wiki/Human_cloning','Human cloning - Wikipedia','Human cloning is the creation of a genetically identical copy (or clone) of a human.The term is generally used to refer to artificial human cloning, which is the reproduction of human cells and tissue.It does not refer to the natural conception and delivery of identical twins.The possibility of human cloning has raised controversies.These ethical concerns have prompted several nations to pass ...','English'),(1681,57,1,'https://www.genome.gov/about-genomics/fact-sheets/Cloning-Fact-Sheet','Cloning Fact Sheet | NHGRI','The term cloning describes a number of different processes that can be used to produce genetically identical copies of a biological entity. The copied material, which has the same genetic makeup as the original, is referred to as a clone.','English'),(1682,57,2,'https://www.medicaldaily.com/science-human-cloning-how-far-weve-come-and-how-far-were-capable-going-340006','The Science Of Human Cloning: How Far We\'ve Come And How ...','The body of the world\'s first cloned sheep, Dolly, is now stuffed and on display at the Museum of Scotland Neil Turner CC BY-NC-ND 2.0. We Can Do It, But Is It Safe? It would be theoretically possible to clone humans, but, to date, there are no records of an actual fully developed human ever being cloned, Live Science reported. The closest we have come to this is the 1997 cloning of our closet ...','English'),(1683,57,3,'https://humancloning.org/','Human cloning','Human Cloning Ancestry Quality resources from cloning to DNA and ancestors','English'),(1684,57,4,'https://www.geneticsandsociety.org/topics/human-cloning','Human Cloning | Center for Genetics and Society','Gallup released its annual Values and Beliefs survey on June 4th. This is the 18th year in which Gallup has conducted its poll about the moral acceptability of various topics, including human cloning, animal cloning, and (since 2002) medical research using stem cells obtained from human embryos.','English'),(1685,57,5,'https://cbhd.org/content/human-cloning','Human Cloning | The Center for Bioethics & Human Dignity','We live in a brave new world in which reproductive technologies are ravaging as well as replenishing families. Increasingly common are variations of the situation in which \"baby\'s mother is also grandma-and sister.\"[1] Sometimes extreme measures are necessary in order to have the kind of child we want.','English'),(1686,57,6,'https://biologywise.com/human-cloning-pros-cons','Human Cloning: The Pros and Cons Highlight Its Risk','Human cloning is the practice of creating genetically identical copy/copies of a person, or cells and tissues of the person. The process is quite similar to the process in which identical twins are born.','English'),(1687,57,7,'https://futurism.com/human-cloning-whats-stopping','Ethical Implications of Human Cloning | Futurism','The technology for successful human cloning is within our reach. But the legal, ethical, and social implications keep us from using it.','English'),(1688,57,8,'https://www.healthline.com/health-news/research-for-human-cloning','How Close Are We to Cloning a Human? - healthline.com','Researchers in China have cloned two monkeys. However, there are a number of medical and ethical hurdles to overcome before this can be tried in humans. Share on Pinterest A pair of cloned monkeys ...','English'),(1689,57,9,'https://www.sciencedaily.com/terms/human_cloning.htm','Human cloning - sciencedaily.com','Human cloning is the creation of a genetically identical copy of an existing, or previously existing, human being or growing cloned tissue from that individual. The term is generally used to refer ...','English'),(1690,57,10,'https://www.theguardian.com/commentisfree/2018/jan/25/afraid-cloning-humans-macaque-monkeys-reality','How afraid of human cloning should we be? | Philip Ball ...','T he cloning of macaque monkeys in China makes human reproductive cloning more conceivable. At the same time, it confirms how difficult it would be to clone a random adult  Adolf Hitler, say ...','English'),(1691,57,11,'https://humancloning.org/allthe.html','All the Reasons to Clone Human Beings | Human Cloning ...','Medical breakthroughs  Human cloning technology is expected to result in several miraculous medical breakthroughs.We may be able to cure cancer if cloning leads to a better understanding of cell differentiation. Theories exist about how cloning may lead to a cure for heart attacks, a revolution in cosmetic surgery, organs for organ transplantation, and predictions abound about how cloning ...','English'),(1692,57,12,'https://healthresearchfunding.org/pros-cons-human-cloning/','Pros and Cons of Human Cloning - HRF','The Cons of Human Cloning. Here are the primary issues associated with human cloning: There is a possibility of faster aging. Because an older cell is often being used to create a human clone, there is the possibility that this imprinted age could be placed on the growing embryo.','English'),(1693,57,13,'https://www.cbsnews.com/news/human-cloning-13-03-2001/','Human Cloning - CBS News','At the headquarters of the Human Cloning Foundation, in the corner of a Greenwich Village lamp shop, more than a half a million people have logged on to the Web site to exchange information. Women ...','English'),(1694,57,14,'https://science.howstuffworks.com/life/genetic/human-cloning.htm','How Human Cloning Will Work | HowStuffWorks','Human cloning has been an ethical issue ever since the first sheep was cloned in 1997. Learn about the science behind human cloning.','English'),(1695,57,15,'https://thenextgalaxy.com/12-disadvantages-and-advantages-of-human-cloning/','12 Disadvantages and Advantages of Human Cloning | Samsung ...','Human cloning is possibly one of the most heated and relevant ethical debates of our time. Cloning is the process of taking genetic material from one organism, and creating an identical copy of it by growing it artificially.','English'),(1696,57,16,'https://www.genome.gov/','National Human Genome Research Institute','About the National Human Genome Research Institute. At NHGRI, we are focused on advances in genomics research. Building on our leadership role in the initial sequencing of the human genome, we collaborate with the world\'s scientific and medical communities to enhance genomic technologies that accelerate breakthroughs and improve lives.','English'),(1697,57,17,'https://www.thoughtco.com/should-human-cloning-be-banned-721486','Should Human Cloning Be Banned? - ThoughtCo','Human cloning is illegal in some states, and institutions that receive U.S. federal funding are prohibited from experimenting with it, but there is no federal ban on human cloning in the United States.','English'),(1698,57,18,'http://www.cbc-network.org/issues/faking-life/human-cloning/','Human Cloning  The Center for Bioethics and Culture','Cited by Science magazine as the breakthrough of 1997, the worlds media flocked to cover the story of a cloned sheep named Dolly by scientists at Scotlands Roslin Institute. While scientists had been cloning animals since 1952, when a tadpole was cloned, the creation of Dolly was significant because it was the first time a mammal had been successfully cloned.','English'),(1699,57,19,'https://medical-dictionary.thefreedictionary.com/human+cloning','Human cloning | definition of human cloning by Medical ...','The percentage of Americans who say they find human cloning morally acceptable has increased, but the overwhelming majority still find it morally unacceptable.','English'),(1700,57,20,'https://greengarageblog.org/16-important-pros-and-cons-of-cloning-humans','16 Important Pros and Cons of Cloning Humans  Green Garage','List of Cons of Cloning Humans. 1. It risks the possibility of faster aging. As older cells are often used to create human clones, it is possible that their imprinted age could be adopted by the growing embryos, which can then create some premature aging issues and, potentially, even premature death.','English'),(1701,57,21,'https://futurism.com/how-close-are-we-to-successfully-cloning-the-first-human','How Close Are We to Successfully Cloning the First Human?','Human cloning may be one of the go-to science fiction tropes, but in reality we may be much closer to achieving it than our fictional heroes might imply','English'),(1702,57,22,'https://www.youtube.com/watch?v=7tbxN5uwaqA','Human Cloning - YouTube','dsc.discovery.com/videos/tech-human-cloning.html We\'ve cloned sheep, mice, dogs and more. So are humans next? Bioethicists talk to Discovery News\' Jorge Ribas about ...','English'),(1703,57,23,'https://science.howstuffworks.com/life/genetic/human-cloning1.htm','Creating a Human Clone - How Human Cloning Will Work ...','If human reproductive cloning proceeds, the primary method scientists will likely use is somatic cell nuclear transfer (SCNT), which is the same procedure that was used to create Dolly the sheep.Somatic cell nuclear transfer begins when doctors take the egg from a female donor and remove its nucleus, creating an enucleated egg.A cell, which contains DNA, is taken from the person who is ...','English'),(1704,57,24,'https://www.britannica.com/science/cloning','cloning | Definition, Process, & Types | Britannica.com','Cloning, the process of generating a genetically identical copy of a cell or an organism. Cloning happens often in nature, as when a cell replicates itself asexually without