 overreacts to a food or a substance in a food, identifying it as a danger and triggering a protective response. While allergies tend to run in families, it is impossible to predict whether a child will inherit a parents food allergy or whether siblings will have a similar condition.','English'),(1774,60,4,'https://en.wikipedia.org/wiki/Food_allergy','Food allergy - Wikipedia','A food allergy is an abnormal immune response to food. The symptoms of the allergic reaction may range from mild to severe. They may include itchiness, swelling of the tongue, vomiting, diarrhea, hives, trouble breathing, or low blood pressure.','English'),(1775,60,5,'https://www.healthline.com/health/allergies/common-food-allergies','Common Food Allergies: Peanuts, Milk, and More - Healthline','The way food allergies are diagnosed usually depends on the severity of symptoms. If your symptoms are mild, a doctor may recommend keeping a food diary to record all of the foods you eat or drink ...','English'),(1776,60,6,'https://www.fda.gov/Food/ResourcesForYou/Consumers/ucm079311.htm','Food Allergies: What You Need to Know - fda.gov','Food Facts for consumers on food allergies, labeling of foods that contain major food allergens, symptoms of an allergic reaction, and reporting a problem with a food\'s labeling.','English'),(1777,60,7,'https://www.foodallergy.org/life-with-food-allergies/food-allergy-101/what-is-a-food-allergy','What is a Food Allergy? | Food Allergy Research & Education','Food allergy is a serious and potentially life-threatening medical condition affecting 32 million Americans. One in every 13 children has a food allergythats about 2 in every U.S. classroom. And every 3 minutes, a food allergy reaction sends someone to the emergency room. Food allergy is among ...','English'),(1778,60,8,'https://medlineplus.gov/foodallergy.html','Food Allergy | Anaphylaxis | Food Allergies | MedlinePlus','Food allergy is an abnormal response to a food triggered by your body\'s immune system.. In adults, the foods that most often trigger allergic reactions include fish, shellfish, peanuts, and tree nuts, such as walnuts. Problem foods for children can include eggs, milk, peanuts, tree nuts, soy, and wheat.','English'),(1779,60,9,'https://www.aaaai.org/conditions-and-treatments/allergies/food-allergies','Food Allergies Symptoms, Diagnosis & Treatment | AAAAI','Food Allergy Overview. If you have a food allergy, your immune system overreacts to a particular protein found in that food. Symptoms can occur when coming in contact with just a tiny amount of the food. Many food allergies are first diagnosed in young children, though they may also appear in older children and adults.','English'),(1780,60,10,'https://www.kidswithfoodallergies.org/page/what-is-a-food-allergy.aspx','What is a Food Allergy? Types, Symptoms, Treatment','A food allergy occurs when the bodys immune system sees a certain food as harmful and reacts by causing symptoms. This is an allergic reaction. Foods that cause allergic reactions are allergens. Two Categories of Food Allergies. Immunoglobulin E (IgE) mediated. Symptoms result from the bodys immune system making antibodies called ...','English'),(1781,60,11,'https://draxe.com/health/allergies/food-allergies-treatments-natural-remedies/','6 Food Allergies Treatments and Natural Remedies - Dr. Axe','Food Allergies vs. Food Intolerance: What Is the Difference? It is estimated that about a quarter of the population will have an adverse reaction to food (of which food allergy is just one type) during their lifetime, especially during infancy and early childhood. Food allergies consist of an immune system response to a disagreeable food.','English'),(1782,60,12,'https://www.cdc.gov/healthyschools/foodallergies/index.htm','Food Allergies | Healthy Schools | CDC','Food allergies are a growing food safety and public health concern that affect an estimated 8% of children in the United States. 1, 2 Thats 1 in 13 children, or about 2 students per clas