of RSI. How to prevent computer-related RSI. These practical tips can help reduce your risk of developing RSI and other related disorders that can arise from working with computers.','English'),(3243,109,5,'https://www.computer-posture.co.uk/mouse-elbow/','Mouse Elbow (Lateral Epicondylitis)  Computer Posture','Mouse Elbow - elbow and arm pain - advice for computer users and RSI avoidance. A genuine ergonomic vertical mouse is the most significant piece of RSI avoidance hardware. It is designed to be used with your arm and wrist muscles at rest.','English'),(3244,109,6,'https://www.computer-posture.co.uk/elbow-pain-computer/','Elbow pain from Computer Use  Computer Posture','Elbow pain for Computer Users is typically a sign of computer related RSI from holding your arm in a fixed posture for extended periods.Usually this is done quite unconsciously! Mouse elbow is traditionally either of Tennis Elbow and Golfers Elbow.These are mirror conditions of each other affecting the muscles and tendons on either side of the elbow joint.','English'),(3245,109,7,'https://www.alexfergus.com/blog/the-best-ergonomic-computer-mouse-and-why-your-wrist-needs-it','The Best Ergonomic Computer Mouse (And Why It\'s Essential ...','The Perfect Computer Mouse for Hand and Wrist Health. In this article, I will look at the relationship between the traditional computer mouse and posture. Ill explain to you why usage of the traditional computer mouse is not optimal, and why you need an alternative ergonomic design, such as an angled mouse, to keep your hands and wrists healthy.','English'),(3246,109,8,'https://lifehacker.com/how-i-beat-repetitive-stress-injury-rsi-with-a-few-mi-5922956','How I Beat Repetitive Stress Injury (RSI) with a Few Minor ...','In 2005, programmer Henrik Warne developed RSIrepetitive stress injury. Over the course of six months, the condition progressed so severely that he considered a career change. Fortunately ...','English'),(3247,109,9,'https://paindoctor.com/mouse-shoulder/','10 Ways To Fix Your Mouse Shoulder Pain, Now - Pain Doctor','10 Ways To Fix Your Mouse Shoulder Pain, Now. ... This condition refers to shoulder pain from using a mouse with your computer without appropriate arm support. It can develop over weeks or months of use. This repetitive strain injury (RSI) from constant repetitive movements in a limited area can lead to real pain problems in your shoulder, neck ...','English'),(3248,109,10,'https://www.nhs.uk/conditions/repetitive-strain-injury-rsi/','Repetitive strain injury (RSI) - NHS','If you work at a computer all day, make sure your seat, keyboard, mouse and screen are positioned so they cause the least amount of strain. See tips on preventing RSI for more detailed advice about using a mouse and keyboard at work.','English'),(3249,109,11,'https://handshoemouse.com/','Home - HandShoe Mouse','Did you know that one in six workers are suffering from some form of RSI or Carpal Tunnel Syndrome, mostly related to intensive use of a traditional computer mouse? The HandShoe Mouse has been developed by a Dutch medical university and has been tested in a number of large organisations for almost two years.','English'),(3250,109,12,'https://en.wikipedia.org/wiki/Repetitive_strain_injury','Repetitive strain injury - Wikipedia','A repetitive strain injury (RSI), is a category of injuries \"to the musculoskeletal and nervous systems that may be caused by repetitive tasks, forceful exertions, vibrations, mechanical compression, or sustained or awkward positions\". Other common names include repetitive stress disorders, cumulative trauma disorders (CTDs), and overuse syndrome.','English'),(3251,109,13,'https://www.amazon.com/rsi-mouse/s?k=rsi+mouse','Amazon.com: rsi mouse','Keyboard Wrist Rest Pad - Full Mouse Pad with Wrist Support Included for Set - Ergonomic Memory Foam Cushion - New Improved Shape - Prevent Carpal Tunnel RSI When Typing on Computer, Mac, Laptop','English'),(3252,109,14,'https://home.bt.com/lifestyle/he