oks popular among Hellenic sightseers and only includes works located ...','English'),(3332,112,4,'https://www.thoughtco.com/the-seven-wonders-of-the-world-4147695','The Ancient World\'s 7 Wonders - ThoughtCo','The seven wonders of the ancient world have been celebrated by scholars, writers, and artists since at least 200 B.C. These marvels of architecture, like Egypt\'s pyramids, were monuments of human achievement, built by Mediterranean and Middle Eastern empires of their day with little more than crude tools and manual labor.','English'),(3333,112,5,'https://www.wonderslist.com/10-wonders-of-the-ancient-world/','10 Wonders of the Ancient World - Wonderslist','We are now presenting our next ten wonders of the ancient world list. It is fortunate that the world is so full of wonderful things that we can keep you infotained with lists of this nature. If you wish to read the others, they are here: Top 10 Wonders of The World Top 10 Natural Wonders of the World 10 Engineering Wonders of The Modern World','English'),(3334,112,6,'https://www.britannica.com/topic/Seven-Wonders-of-the-World','Seven Wonders of the World | List & Pictures | Britannica.com','Seven Wonders of the World, preeminent architectural and sculptural achievements of the ancient Mediterranean and Middle East, as listed by various observers. The best known are those of the 2nd-century-bce writer Antipater of Sidon and of a later but unknown observer of the 2nd century bce who ...','English'),(3335,112,7,'https://www.wonders-of-the-world.net/Seven/List-of-the-seven-wonders-of-the-ancient-world.php','List of the Seven Wonders of the Ancient World','List of the seven wonders of the ancient world, with the pyramid of Cheops, the lighthouse of Alexandria, the temple of Artemis, the mausoleum of Halicarnassus, the hanging gardens of Babylon, the colossus of Rhodes and the statue of Zeus','English'),(3336,112,8,'https://www.youtube.com/watch?v=86FyWTKzxpI','Seven Wonders of the Ancient World - YouTube','What 