English'),(3346,112,18,'https://www.wonders-of-the-world.net/Seven/List-of-the-seven-wonders-of-the-modern-world.php','List of the Seven Wonders of the modern World','Although the seven wonders of the ancient world were listed definitively from antiquity on the basis of various lists previously established, the seven wonders of the modern world were designated following a vote organized by the New Seven Wonders Foundation, foundation created by the Swiss businessman Bernard Weber linked to a private marketing company.','English'),(3347,112,19,'https://ancientcivilizationsworld.com/seven-wonders/','Seven Wonders Of The Ancient World: Complete List and History','Seven Wonders of the ancient world  Mausoleum at Halicarnassus They attribute to his sister, and at the same time loved wife Artemisia, the construction of the tomb in honor of her brother. Apparently, Artemisia governed Halicarnassus for two years after he died and later, another brother named Idrieus finished the work.','English'),(3348,112,20,'https://www.ancienthistorylists.com/ancient-civilizations/7-wonders-of-the-ancient-world/','The 7 Wonders of the Ancient World - AncientHistoryLists','The seven wonders of the ancient world are examples of exceptional pieces of classical architecture and human achievement. The first list of the seven wonders dates back to the first or second century BC when it acted as a kind of guidebook for Hellenic sightseers. Compiled by ancient scholars, the list contains the most astounding centerpieces of great architecture and engineering and ...','English'),(3349,112,21,'https://www.amazon.com/Seven-Wonders-Ancient-World/dp/0415050367','Amazon.com: The Seven Wonders of the Ancient World ...','The Seven Wonders is a great book to introduce anyone to the wonders of the ancient world. I have always been fascinated with history and the technologies of the ancients. This book brings together true architectural wonders. Each of the seven is given its own chapter to fully describe the structure and its history.','English'),(3350,112,22,'https://kids.nationalgeographic.com/explore/history/seven-wonders/','Seven Wonders of the Ancient World','Seven Wonders of the Ancient World. From pyramids to temples, our ancestors knew how to get things done. By Elisabeth Deffner. More than 2,000 years ago, travelers would write about incredible sights they had seen on their journeys. Over time, seven of those places made history as the \"wonders of the ancient world.\" Check them out here.','English'),(3351,112,23,'https://www.worldatlas.com/articles/the-7-wonders-of-the-world.html','The Seven Wonders of the World - WorldAtlas.com','Seven Natural Wonders of the World The Seven Natural Wonders of the World is an unofficial list of the most spectacular places in nature from around the globe. Seven Wonders of the Ancient World The Seven Wonders of the Ancient World include picks from ancient times, such as the Lighthouse of Alexandria, the Temple of Artemis, the Statue of ...','English'),(3352,112,24,'https://civilization.fandom.com/wiki/Wonders_of_the_Ancient_World_(Civ5)','Wonders of the Ancient World (Civ5) | Civilization Wiki ...','Wonders of the Ancient World is a DLC released on 11 August 2011 for Civilization V. It adds three new wonders and a scenario. The scenario is a contest between five ancient civilizations to have the highest score when the nine available wonders are built. The wonders in the scenario are the...','English'),(3353,112,25,'https://ancient-code.com/seven-wonders-ancient-world-today/','What the \'Seven Wonders of the Ancient World\' Would Look ...','The only Wonder of the Seven Wonders of the Ancient World to still stand to this day, the Pyramid of Giza is a sight to behold. Dated to about 4,500 years old, those who built Giza did so with blocks of Limestone and Granite that weighed up to 15 tons a piece.','English'),(3354,112,26,'https://www.amazon.com/Seven-Wonders-Ancient-World/dp/068983182X','The Seven Wonders of the Ancient World: Lynn Curlee ...','The Seven Wonders of the Ancient World [Lynn Curlee] on Amazon.com. *FREE* shipping on qualifying offers. The Hanging Gardens of Babylon. The Colossus of Rhodes. The Great Pyra-mid at Giza. For centuries these names have inspired wonder and mystery. They are but three of the Seven Wonders of the Ancient World. Most of these masterpieces of human achievement have long since crumbled into dust.','English'),(3355,112,27,'https://www.icoregames.com/7-wonders-of-the-ancient-world-pc-game/','7 Wonders of the Ancient World PC Game | Free Full Version','Download Free 7 Wonders of the Ancient World Full Version Game Information: 7 Wonders of the Ancient World is a puzzle video game released on February 2, 2007 for Nintendo DS, PS2, PSP and Windows. It was developed by Hot Lava Games and published by MumboJumbo.','English'),(3356,112,28,'https://mymodernmet.com/7-wonders-of-the-world/','What are the Seven Wonders of the World, from Ancient to ...','The only surviving ancient wonder, the Great Pyramid at Giza remains an incredible example of Egyptian architecture. A visual representation of the ancient Egyptians sophistication, it was the tallest man-made structure in the world for 3,800 years. The oldest of the seven wonders, Egyptologists believe it took just 10 to 20 years to build.','English'),(3357,112,29,'https://www.thoughtco.com/seven-wonders-of-the-modern-world-1434539','Discover the Seven Wonders of the Modern World - ThoughtCo','The American Society of Civil Engineers selected Seven Wonders of the Modern World, engineering marvels that exemplify the abilities of humans to construct amazing features on Earth. The following guide takes you through these Seven Wonders of the Modern World and describes each \"wonder\" and its impact.','English'),(3358,113,0,'https://www.bird-rescue.org/our-work/research-and-education/how-oil-affects-birds.aspx','How Oil Affects Birds - International Bird Rescue','When there is an oil spill, it\'s impossible to know in advance how many birds will be impacted. International Bird Rescue works with local state and federal biologists to look at what animals are in the area at the time of a spill and try to determine what species and how many of them may be exposed to oil.','English'),(3359,113,1,'https://www.thespruce.com/how-oil-affects-birds-386496','How Oil Spills Affects Birds - The Spruce','Massive oil spills often make headlines because of their destructive impact on wildlife and the environment. What many people don\'t realize, however, is that even a small amount of oil, no more than a dime-sized drop, can be deadly to birds.Understanding how oil affects birds can raise awareness of just how hazardous any oil spill or similar pollution can be.','English'),(3360,113,2,'https://en.wikipedia.org/wiki/List_of_natural_gas_and_oil_production_accidents_in_the_United_States','List of natural gas and oil production accidents in the ...','State had active oil and or gas wells as of April 2015 but no accidents have been uncovered.  Major crude oil train derailment in Mosier, a small town in the Columbia gorge spilled and burst into flames June 2016. The accident was due to railway dysfunction and bad parts.','English'),(3361,113,3,'https://www.nrdc.org/onearth/oils-spills-are-even-worse-birds-we-thought','Oil Spills Are Even Worse for Birds than We Thought | NRDC','Oil Spills Are Even Worse for Birds than We Thought ... surface had to expend approximately 20 percent more energy than birds flying oil-free. ... the safety of millions of peopleand their ...','English'),(3362,113,4,'https://www.mnn.com/earth-matters/wilderness-resources/stories/the-13-largest-oil-spills-in-history','The 13 largest oil spills in history | MNN - Mother Nature ...','More than 15,000 sea birds and enormous numbers of aquatic animals were killed before the spill was finally contained. ... The worst oil spill in history wasn\'t an accident  it was deliberate ...','English'),(3363,113,5,'https://en.wikipedia.org/