ble Species  Less than 2,000 in the Wild According to the census of 2014, there are only 1,864 giant pandas alive in the wild. It is one of the rarest and most ...','English'),(3556,119,18,'http://wwf.panda.org/what_we_do/endangered_species/giant_panda/panda/panda_survey/','WWF - Panda','Camera traps in China have captured images and video footage of giant pandas that are often difficult to see in the wild. The photographs and video are some of the most amazing images ever of pandas and other species in their remote habitat, which were caught on film as part of long-term wildlife monitoring projects set up in panda nature reserves by the Chinese government and WWF.','English'),(3557,119,19,'https://www.pandasinternational.org/panda-reserves/','Panda Reserves | Pandas International','Today there are approximately 40 panda reserves across Southwestern China. Some are Nature Reserves providing a safe habitat for wild Giant Pandas, like a National Park Other reserves protect the wild Giant Pandas while having scientific research centers to study their behavior and for breeding captive Giant Pandas.','English'),(3558,119,20,'https://www.youtube.com/watch?v=OL1cuDAOkFA','Panda Sighting in the Wild - YouTube','With less than 1,600 giant pandas remaining in the wild, spotting a wild giant panda is rare. After 10 days of waiting, our film crew\'s patience pays off.','English'),(3559,119,21,'https://nationalzoo.si.edu/animals/giant-panda','Giant panda | Smithsonian\'s National Zoo','The Smithsonian\'s National Zoo and Conservation Biology Institute is a leader in giant panda conservation. Ever since these charismatic bears arrived at the Zoo in 1972, animal care staff and scientists have studied giant panda biology, behavior, breeding, reproduction and disease.','English'),(3560,119,22,'https://www.telegraph.co.uk/travel/destinations/asia/china/articles/Pandas-where-to-see-them-in-China/','Pandas: where to see them in China - Telegraph','Trekking to see pandas in the wild is difficult. A clutch of tour companies claim to offer the experience, but there are no guarantees of sightings. Panda China Tour is one ( www.pandachinatour.com ).','English'),(3561,119,23,'https://www.nationalgeographic.com/magazine/2016/08/giant-pandas-wild-animals-national-parks/','Pandas Get to Know Their Wild Side - nationalgeographic.com','How many wild pandas are out there? Researchers have been trying to count them since the 1970s, when it is thought there were roughly 2,500 animals. ... To set the mood, breeders in China have ...','English'),(3562,119,24,'https://www.worldwildlife.org/species/red-panda','Red Panda | Species | WWF','Red pandas are often killed when they get caught in traps meant for other animals such as wild pigs and deer. They are also poached for their distinctive pelts in China and Myanmar. Red panda fur caps or hats have been found for sale in Bhutan.','English'),(3563,119,25,'https://www.onthegotours.com/China/Visiting-Pandas-in-China','The best places to see pandas in China | On The Go Tours','Best Places to See Pandas in China. Many of China\'s panda research bases are located in the Sichuan province where wild pandas still exist today. The city of Chengdu is known as the panda capital of the world thanks to the important conservation centres situated here and it makes an obvious choice for those wanting a chance to see the cuddly ...','English'),(3564,119,26,'https://www.pandasinternational.org/reserves-zoos/','Reserves & Zoos | Pandas International','Today there are approximately 40 panda reserves across Southwestern China. Some are Nature Reserves providing a safe habitat for wild Giant Pandas, like a National Park Other reserves protect the wild Giant Pandas while having scientific research centers to study their behavior and for breeding captive Giant Pandas.','English'),(3565,119,27,'https://www.activewild.com/panda-facts-kids/','Panda Facts For Kids & Adults: Information, Pictures & Video','Pandas have been an endangered species for a many years. This is because much of the pandas natural habitat has been cleared to make way for farms and other development. Once there were wild pandas living throughout China, but now they are restricted to the mountains. How Many Pandas Are Left In The Wild?','English'),(3566,119,28,'http://infomory.com/numbers/number-of-giant-pandas-in-the-world/','Number of Giant Pandas in the World - A Knowledge Archive','Number of Giant Pandas in the World. April 16, 2010, charm, Leave a comment. How many Giant Pandas are alive in the world? Approximately 3,239 pandas. Giant pandas have become national icons in China. To date, there are 239 giant pandas bred in captivity, according to a 2007 news report in a Chinese online news journal.','English'),(3567,119,29,'https://www.reference.com/pets-animals/pandas-live-64dff22c2fe56e9','Panda Habitats in the Wild | Reference.com','Conservation efforts seem to be making successful strides in increasing the panda population. In the 1970s there were as few as 1,000 pandas living in their natural habitat. A 2014 census found more than 1,800 pandas now living in the wild.','English'),(3568,120,0,'https://www.reference.com/science/unit-frequency-dce3518eabd09c40','What Is the Unit for Frequency? | Reference.com','The unit for frequency in the International System of Units is hertz, which is abbreviated as Hz. One hertz is defined as a frequency of one cycle per second. The clock rate of computer central processing units are measured in megahertz or gigahertz, which allow consumers to compare CPU performance.','English'),(3569,120,1,'https://en.wikipedia.org/wiki/Frequency','Frequency - Wikipedia','Frequency is the number of occurrences of a repeating event per unit of time. It is also referred to as temporal frequency, which emphasizes the contrast to spatial frequency and angular frequency. The period is the duration of time of one cycle in a repeating event, so the period is the reciprocal of the frequency.','English'),(3570,120,2,'https://www.quora.com/What-is-the-unit-used-to-measure-frequency','What is the unit used to measure frequency? - Quora','Hertz, unit of frequency. The number of hertz (abbreviated Hz) equals the number of cycles per second. The frequency of any phenomenon with regular periodic variations can be expressed in hertz, but the term is used most frequently in connection w...','English'),(3571,120,3,'https://en.wikipedia.org/wiki/Hertz','Hertz - Wikipedia','The hertz (symbol: Hz) is the derived unit of frequency in the International System of Units (SI) and is defined as one cycle per second. It is named after Heinrich Rudolf Hertz, the first person to provide conclusive proof of the existence of electromagnetic waves.','English'),(3572,120,4,'http://www.qrg.northwestern.edu/projects/vss/docs/Communications/1-what-is-frequency.html','What is frequency? - Northwestern University','Usually frequency is measured in the hertz unit, named in honor of the 19th-century German physicist Heinrich Rudolf Hertz. The hertz measurement, abbreviated Hz, is the number of waves that pass by per second. For example, an \"A\" note on a violin string vibrates at about 440 Hz (440 vibrations per second). What are radio waves? ...','English'),(3573,120,5,'https://www.britannica.com/science/frequency-physics','frequency | Definition, Symbols, & Formulas | Britannica.com','Omega is usually used to describe the angular frequencythat is, how much an object rotates or revolves in radians per unit time. Usually frequency is expressed in the hertz unit, named in honour of the 19th-century German physicist Heinrich Rudolf Hertz, one hertz being equal to one cycle per second, abbreviated Hz; one kilohertz (kHz) is ...','English'),(3574,120,6,'https://www.answers.com/Q/What_is_frequency_measured_in','What is frequency measured in? - Answers.com','== Frequency speaks to the number of oscillations per unit of time. Oscillations or cycles per unit of time is a concept applied to some kind of repeating or harmonic motion or wave, and it could ...','English'),(3575,120,7,'https://www.convertunits.com/type/frequency','Frequency unit conversion - SI derived quantity','SI derived quantity: frequency. This category of measurement units is defined by the \"frequency\" type, which is an SI derived quantity.  SI unit: hertz The SI derived unit for frequency is the hertz.','English'),(3576,120,8,'https://answers.yahoo.com/question/index?qid=20090122154413AApXkQR','what is the unit of frequency? | Yahoo Answers','Frequency is the speed of a wave divided by its wavelength. That would be a (m / s) / m, which is simply 1/s. We call this a Hz, but I have no idea why we wouldn\'t want to leave it as \"per second\".','English'),(3577,120,9,'https://www.reference.com/science/frequency-measured-c6c595096c2dd3e0','What Is Frequency Measured In? | Reference.com','The most common unit used to measure frequency is hertz (Hz), which refers to cycles per second; however, there are some other ways to measure frequency, such as revolutions per minute (RPM) for a motor or beats per minute (BPM) for a person\'s heartbeat.','English'),(3578,120,10,'https://www.dictionary.com/browse/frequency','Frequency | Definition of Frequency at Dictionary.com','Frequency definition, the state or fact of being frequent; frequent occurrence: We are alarmed by the frequency of fires in the neighborhood. See more.','English'),(3579,120,11,'https://whatis.techtarget.com/definition/frequency','What is frequency? - Definition from WhatIs.com','frequency: For an oscillating or varying current , frequency is the number of complete cycles per second in alternating current direction. The standard unit of frequency is the hertz , abbreviated Hz. If a current completes one cycle per second, then the frequency is 1 Hz; 60 cycles per second equals 60 Hz (the standard alternating-current ...','English'),(3580,120,12,'https://www.merriam-webster.com/dictionary/frequency','Frequency | Definition of Frequency by Merriam-Webster','Frequency definition is - the fact or condition of occurring frequently. How to use frequency in a sentence. the fact or condition of occurring frequently See the full definition. SINCE 1828. Menu. ... the number of times that a periodic function repeats the same sequence of values during a unit variation of the independent variable. b: the ...','English'),(3581,120,13,'https://www.mathsisfun.com/algebra/amplitude-period-frequency-phase-shift.html','Amplitude, Period, Phase Shift and Frequency - Math Is Fun','Amplitude, Period, Phase Shift and Frequency . Some functions (like Sine and Cosine) repeat forever and are called Periodic Functions.. The Period goes from one peak to the next (or from any point to the next matching point):. The Amplitude is the height from the center line to the peak (or to the trough). Or we can measure the height from highest to lowest points and divide that by 2.','English'),(3582,120,14,'http://pages.uoregon.edu/soper/Light/frequency.html','Wavelength and Frequency','We denote wavelength by Frequency is how many complete waves go by per second. We denote frequency by Frequency is measured in Hertz = Hz = 1/seconds. If a wave with a wavelength of 2 meters is going by at a speed of 6 meters/second, then 3 complete waves go by in 1 second. That is, the frequency is 6/2 = 3 waves/second, or 3 Hz. (See units ).Thus','English'),(3583,120,15,'https://www.answers.com/Q/What_is_the_SI_Unit_for_Frequency','What is the SI Unit for Frequency? - Answers.com','Frequency f is a measure of the number of occurrences of a repeating event per unit time. It is also referred to as temporal frequency. The period is the duration of one cycle in a repeating event ...','English'),(3584,120,16,'https://www.asknumbers.com/FrequencyConversion.aspx','Frequency Converter - Convert Hz, kHz, MHZ, GHz','Frequency is defined as the measure of the number of occurrences of a repeating event per unit time. To calculate the frequency, the number of occurrences of the 