quency tels us how many complete oscillations are performed in one second. ...','English'),(3589,120,21,'https://courses.lumenlearning.com/physics/chapter/16-2-period-and-frequency-in-oscillations/','Period and Frequency in Oscillations | Physics','A concept closely related to period is the frequency of an event. For example, if you get a paycheck twice a month, the frequency of payment is two per month and the period between checks is half a month. Frequency f is defined to be the number of events per unit time. For periodic motion, frequency is the number of oscillations per unit time.','English'),(3590,120,22,'https://www.lorecentral.org/2018/10/what-is-the-difference-between-frequency-and-wavelength.html','What is the difference between frequency and wavelength ...','frequency = speed / wavelength. The wavelength is usually represented by the Greek letter lambda (?) and in the International System of Units it is measured in meters . The frequency is usually represented by the letter v or f and is measured in hertz or cycles per second (Hz).','English'),(3591,120,23,'http://kentchemistry.com/links/AtomicStructure/waveequations.htm','Wavelegnth, Frequency and Energy Calculations','In other words, all energy is a multiple of this constant multiplied by the frequency of the wave of light. Energy is therefore quantized, it is always a multiple of a single packet of energy. Now on to the equations. Wavelength (l) and Frequency (n) Relationships. c=ln , where l is wavelength in meters. n is frequency in hertz, 1/s or s-1','English'),(3592,120,24,'https://www.convertworld.com/en/frequency/hertz.html','Convert Frequency, Hertz - Unit Conversion Online','Share Hertz (Hz - Frequency), frequency. The hertz (symbol: Hz) is the SI unit of frequency. Its base unit is s-1 (also called inverse seconds, reciprical seconds, or 1/s). In English, hertz is used as both singular and plural.','English'),(3593,120,25,'https://www.thoughtco.com/definition-of-frequency-605149','Frequency 