ste, as well as the maintenance of the plant.','English'),(3775,126,27,'http://www.softschools.com/examples/science/nuclear_energy_examples/164/','Nuclear Energy Examples - Softschools.com','Nuclear energy is energy that is stored within the nucleus of atoms. The only way for this energy to be released is through the splitting of or joining of atomic nuclei. A chemical reaction cannot release nuclear energy. Nuclear energy is our most concentrated form of energy. In other words, we get ...','English'),(3776,126,28,'https://www.aecl.ca/','AECL','Driving Nuclear Opportunity for Canada. AECLs vision is to realize value to Canadians by driving nuclear innovation, creating a state-of-the-art nuclear campus, and cleaning up our legacy wastes.','English'),(3777,126,29,'https://world-nuclear.org/information-library/current-and-future-generation/outline-history-of-nuclear-energy.aspx','History of Nuclear Energy - World Nuclear Association','Outline History of Nuclear Energy (Updated April 2019) The science of atomic radiation, atomic change and nuclear fission was developed from 1895 to 1945, much of it in the last six of those years.','English'),(3778,127,0,'https://en.wikipedia.org/wiki/Solar_eclipse','Solar eclipse - Wikipedia','A solar eclipse occurs when a portion of the Earth is engulfed in a shadow cast by the Moon which fully or partially blocks (\"occults\") sunlight.This occurs when the Sun, Moon and Earth are aligned. Such alignment coincides with a new moon indicating the Moon is closest to the ecliptic plane.In a total eclipse, the disk of the Sun is fully obscured by the Moon.','English'),(3779,127,1,'https://www.space.com/15584-solar-eclipses.html','Solar Eclipses: When Is the Next One? | Space','Editor\'s note: The next total solar eclipse will occur over Chile and Argentina on July 2, 2019. See our full coverage here. A solar eclipse occurs when the moon gets between Earth and the sun ...','English'),(3780,127,2,'https://eclipse.gsfc.nasa.gov/solar.html','NASA - Solar Eclipse Page','This is NASA\'s official solar eclipse page. It contains maps and tables for 5,000 years of lunar eclipses and includes information on eclipse photography and observing tips.','English'),(3781,127,3,'https://www.greatamericaneclipse.com/','Total solar eclipse of April 8, 2024','A total solar eclipse is unlike anything you\'ve seen in your life. As totality approaches, you will see the astonishing sight of day turning to night and the Sun\'s corona blazing in the sky. This is truly a great American eclipse because totality will sweep the nation from the Pacific to the Atlantic.','English'),(3782,127,4,'https://www.timeanddate.com/eclipse/solar-eclipse.html','What Is a Solar Eclipse - timeanddate.com','Solar eclipses are usually named for their darkest, or maximum, point. The exception is the hybrid eclipse. The darkest point of solar eclipses is only visible from a small area. In most places and for most of the duration, total, annular, and hybrid eclipses look like a partial solar eclipse. Only around New Moon. For a solar eclipse to take ...','English'),(3783,127,5,'https://www.exploratorium.edu/eclipse','Total Solar Eclipse July 2019 - Live Stream From Chile ...','TOTAL SOLAR ECLIPSE: LIVE FROM CHILE JULY 2, 2019. This July 2, the Exploratorium continues its 20-year tradition of bringing live images of eclipses to youwere traveling to the National Science Foundation\'s Cerro Tololo Observatory in Chile to broadcast a total solar eclipse visible overhead from parts of South America.','English'),(3784,127,6,'https://eclipse2017.nasa.gov/','Eclipse 2017','Total Solar Eclipse 2017 - On Monday, August 21, 2017, all of North America will be treated to an eclipse of the sun. Anyone within the path of totality can see one of natures most awe inspiring sights - a total solar eclipse. This path, where the moon will completely cover the sun and the sun\'s tenuous atmosphere - the corona - can be seen, will stretch from Salem, Oregon to Charleston ...','English'),(3785,127,7,'https://www.timeanddate.com/eclipse/total-solar-eclipse.html','Total Solar Eclipse Science - Time and Date','Total solar eclipses occur when the New Moon comes between the Sun and Earth and casts the darkest part of its shadow, the umbra, on Earth. A full solar eclipse, known as totality, is almost as dark as night.','English'),(3786,127,8,'https://eclipse2017.nasa.gov/eclipse-who-what-where-when-and-how','Eclipse: Who? What? Where? When? and How? | Total Solar ...','Total Solar Eclipse 2017 - On Monday, August 21, 2017, all of North America will be treated to an eclipse of the sun. Anyone within the path of totality can see one of natures most awe inspiring sights - a total solar eclipse. This path, where the moon will completely cover the sun and the sun\'s tenuous atmosphere - the corona - can be seen, will stretch from Salem, Oregon to Charleston ...','English'),(3787,127,9,'https://en.wikipedia.org/wiki/Solar_eclipse_of_August_21,_2017','Solar eclipse of August 21, 2017 - Wikipedia','The solar eclipse of August 21, 2017, dubbed the \"Great American Eclipse\" by the media, was a total solar eclipse visible within a band that spanned the entire contiguous United States, passing from the Pacific to the Atlantic coasts.','English'),(3788,127,10,'https://www.nasa.gov/eclipselive/','2017 Solar Eclipse Live - nasa.gov','NASA covers the August 21 solar eclipse live from coast to coast, from unique vantage points on the ground and from aircraft and spacecraft, including the International Space Station.','English'),(3789,127,11,'https://time.com/4882923/total-solar-eclipse-map-places-view/','Solar Eclipse Map: See How the Eclipse Will Look Near You ...','The 2017 total solar eclipse is fast approaching, and hordes of sky gazers are scrambling to find a spot where they can see the shadow of the moon completely obscure the sun for a few moments on ...','English'),(3790,127,12,'https://www.youtube.com/watch?v=cxrLRbkOwKs','Solar Eclipse 101 | Nati