un is completely blocked out by...','English'),(3796,127,18,'https://spaceplace.nasa.gov/eclipse-snap/en/','What Is a Solar Eclipse? | NASA Space Place  NASA Science ...','For information about how to safely view an eclipse, go here: eclipse2017.nasa.gov/safety What is a solar eclipse? A solar eclipse happens when, at just the right moment, the moon passes between the sun and Earth. Learn all about solar eclipses in this video! Download a poster of this animation!','English'),(3797,127,19,'https://www.space.com/33797-total-solar-eclipse-2017-guide.html','Here Are the Most Amazing Photos and Videos of the 2017 ...','Space is supported by its audience. When you purchase through links on our site, we may earn an affiliate commission. Learn more Here Are the Most Amazing Photos and Videos of the 2017 Solar Eclipse','English'),(3798,127,20,'https://spaceplace.nasa.gov/eclipses/en/','Lunar Eclipses and Solar Eclipses | NASA Space Place ...','A solar eclipse happens when the moon gets in the way of the suns light and casts its shadow on Earth. That means during the day, the moon moves over the sun and it gets dark. Isnt it strange that it gets dark in the middle of the day? This total eclipse happens about every year and a half ...','English'),(3799,127,21,'https://eclipse.gsfc.nasa.gov/SEgoogle/SEgoogle2001/SE2017Aug21Tgoogle.html','NASA - Total Solar Eclipse of 2017 Aug 21','Predictions for the Total Solar Eclipse of 2017 Aug 21 were generated using the JPL DE405 solar and lunar ephemerides and a value of T = 68.4 seconds. The eclipse predictions presented here DO NOT include the effects of mountains and valleys along the edge of the Moon.','English'),(3800,127,22,'https://www.merriam-webster.com/dictionary/solar%20eclipse','Solar Eclipse | Definition of Solar Eclipse by Merriam-Webster','Solar eclipse definition is - an eclipse of the sun by the moon.','English'),(3801,127,23,'https://terraria.gamepedia.com/Solar_Eclipse','Solar Eclipse - The Official Terraria Wiki','\"