'),(3806,127,28,'https://twitter.com/nasasun','NASA Sun & Space (@NASASun) | Twitter','The latest Tweets from NASA Sun & Space (@NASASun). We study the Sun and how it affects space around Earth and other worlds, producing key knowledge to protect astronauts, satellites and robotic missions. NASA Goddard, Greenbelt, MD','English'),(3807,127,29,'https://space-facts.com/solar-eclipse/','Solar Eclipse Facts - Total, Annular & Partial Solar Eclipses','Total Solar Eclipse. A total solar eclipse occurs when the Moon completely blocks the solar disk. In a total solar eclipse, the narrowest part of the path (where the Sun is completely blocked and the Moon casts its darkest shadow (called the umbra)) is called the zone of totality.','English'),(3808,128,0,'https://en.wikipedia.org/wiki/Doping_in_sport','Doping in sport - Wikipedia','Doping existed in other countries, says the expert Jean-Pierre de Mondenard, both communist and capitalist, but the difference with East Germany was that it was a state policy. The Sportvereinigung Dynamo (English:Dynamo Sports Club) was especially singled out as a center for doping in the former East Germany.','English'),(3809,128,1,'https://www.bbc.com/sport/athletics/33997246','Doping in sport: What is it and how is it being tackled ...','The issue of doping in sport has been widely discussed in recent weeks, but what exactly is it? BBC Sport explains what it means, why it has become a hot topic, what the types of doping are and ...','English'),(3810,128,2,'https://www.forbes.com/sites/roomykhan/2017/12/31/doping-in-sports-cheating-or-leveling-of-the-playing-field/','Doping In Sports - Cheating Or Leveling Of The Playing Field?','Forbes Daily Cover Stories ... Doping In Sports - Cheating Or Leveling Of The Playing Field? ... weightlifting, boxing, wrestling, ice hockey, rugby, and other sports, all have a track record of ...','English'),(3811,128,3,'http://www.theathlete.org/doping-in-sport.htm','Doping in sports - a deadly game - theathlete.org','Doping in Sports - A deadly Game \"The potential benefits to society and to the individual from sport will only be maximised where fair play is centre stage\" Council of Europe Introduction. Sport goes beyond a measure of athletic excellence and the winning of trophies and medals.','English'),(3812,128,4,'https://www.ncbi.nlm.nih.gov/pmc/articles/PMC2219897/','Doping in sports and its spread to at-risk populations: an ...','Doping became so prevalent in Olympic sport that some argued that all records should be discarded or put on hold until all forms of doping could be detected and stopped. Through the 1980s and 1990s, clandestine doping programs spread from sport to sport guided by modern, albeit unethical, pharmacists and sports medicine professionals.','English'),(3813,128,5,'https://www.medicalnewstoday.com/articles/305421.php','Doping in sports: is it worth it? - Medical News Today','Doping in sports is a big issue. What is it and what is being done to stop it? This spotlight looks at some of the issues, including gene doping and blood boosting.','English'),(3814,128,6,'https://en.wikipedia.org/wiki/List_of_doping_cases_in_sport','List of doping cases in sport - Wikipedia','The following is an incomplete list of sportspeople who have been involved in doping offences. It contains those who have been found to have, or have admitted to having, taken illegal performance-enhancing drugs, prohibited recreational drugs or have been suspended by a sports governing body for failure to submit to mandatory drug testing.','English'),(3815,128,7,'http://theconversation.com/how-to-argue-about-doping-in-sport-43600','How to argue about doping in sport - The Conversation','There has been a huge amount of academic, policy, and public debate over the years about doping in sport (i.e. the use of banned performance enhancing substances or drugs and other prohibited ...','English'),(3816,128,8,'https://www.bbc.com/sport/38884801','Doping in sport: Drug use \'fast becoming a crisis ...','Key stats from a ComRes/BBC doping in amateur sport poll Drug use at every level of sport is \"fast becoming a crisis\" according to UK Anti-Doping - responding to a BBC poll into doping in amateur ...','English'),(3817,128,9,'https://www.webmd.com/fitness-exercise/blood-doping','Blood Doping: Types, Risks, and Tests - WebMD','Blood doping is an illicit method of improving athletic performance by artificially boosting the blood\'s ability to bring more oxygen to muscles. In many cases, blood doping increases the amount ...','English'),(3818,128,10,'http://www.unesco.org/new/en/social-and-human-sciences/themes/anti-doping/youth-space/what-is-doping/','What is doping? | United Nations Educational, Scientific ...','As you continue to participate in sport, doping is an issue that you will increasingly face: you could be tested for drugs; some of your competitors will be cheating by using drugs; you may even be tempted to do so yourself.','English'),(3819,128,11,'https://www.youtube.com/watch?v=MmqXcQW2BEI','The Disturbing Truth About Doping in Sports - YouTube','Athletes have looked for a chemical edge for centuries -- dating all the way back to the ancient Greeks who used alcoholic concoctions and hallucinogenic mushrooms. Thanks to newer technologies ...','English'),(3820,128,12,'https://www.theguardian.com/sport/drugs-in-sport','Drugs in sport | Sport | The Guardian','Drugs in sport . October 2019. ... The response of the IAAF president and the athletics commentariat to the doping ban of Alberto Salazar, Mo Farahs former coach, is little short of nauseating ...','English'),(3821,128,13,'https://healthresearchfunding.org/doping-sports-pros-cons/','Doping in Sports Pros and Cons - HRF','The Pros of Doping in Sports. Physical Abilities Improvements Doping in sports can enhance your physical abilities in a short period of time. Performance enhancing drugs or steroids can increase muscle mass and provide large amount of stamina to enhance your athletic abilities and endurance.','English'),(3822,128,14,'https://sportsscientists.com/sports-science/doping/','Doping | The Science of Sport','Welcome to the Science of Sport where we bring you the second, third, and fourth level of analysis you will not find anywhere else.. Be it doping in sport, hot topics like Caster Semenya or Oscar Pistorius, or the dehydration myth, we try to translate the science behind sports and sports performance.Consider a donation if you like what you see here!','English'),(3823,128,15,'https://www.slideshare.net/drcorp/doping-in-sports','Doping in sports - SlideShare','Doping in sports 1. Dr. Abhijit Salvi MBBS, Masters in Sports Medicine (U.K) BCCI Anti-Doping and Age-Verification Officer 2. Dope  from Dutch word Dop  an alcoholic beverage from grape skins, used by Zulu warriors to enhance their power in battle. 3.','English'),(3824,128,16,'https://www.sportsmedtoday.com/doping-va-119.htm','DOPING | Sports Medicine Today','The frequency and type of testing varies between sport based upon a variety of factors including history of doping in the sport, type of sports (e.g., endurance, strength/power), substances being taken, and duration of the season. Penalties for a doping violation vary greatly between sports.','English'),(3825,128,17,'https://journalofethics.ama-assn.org/article/physicians-and-sports-doping-epidemic/2014-07','Physicians and the Sports Doping Epidemic | Journal of ...','Doping in Sport. Physicians dope athletes for a variety of reasons that can range from unethical service to the state to the gratifying of their own immature emotional needs. The East German doctors who participated in the doping of thousands of young athletes, including the administration of anabolic steroids to pubescent girls, functioned ...','English'),(3826,128,18,'https://healthresearchfunding.org/35-surprising-doping-sports-statistics/','35 Surprising Doping in Sports Statistics - HRF','In the United Kingdom, rugby is the #1 sport for doping. Between rugby league and rugby union, 27 players have been banned, almost all due to a banned stimulant. 6. Cycling and boxing are with 0.2% of weightlifting for the most doping within their sport. 7. Many sports have seen improvements since 2004, especially cycling.','English'),(3827,128,19,'https://speedypaper.com/essays/doping-in-sports','Doping in Sports | SpeedyPaper.com','Doping as sports has been a serious issue since 1988 following the stripping of the gold medal of Johnson Ben. Johnson was banned for life in 1993 (Keim, 2014). Though the Olympics committee first investigated doping, there has been good government will in the banning of doping in sports.','English'),(3828,128,20,'https://www.medscape.com/features/slideshow/history-of-doping-in-sports','Faster, Higher, Stronger: A History of Doping in Sports','Doping and Modern Medicine. With the advent of modern medicine in the 19th century, taking stimulants to enhance energy use, production, and recovery in sport competition grew in popularity.','English'),(3829,128,21,'https://www.drugs.com/wada/','Drugs Banned in Sport: World Anti-Doping Prohibited List','World Anti-Doping Code Prohibited List. The World Anti-Doping Code Prohibited List is an International Standard. The List groups substances and methods by those that are banned at all times (in and out of competition), those that are banned in-competition only, and those that are banned by a particular sport.','English'),(3830,128,22,'http://www.academia.edu/Documents/in/Doping_in_Sport','Doping in Sport Research Papers - Academia.edu','Results: The participants sharing in the study by using social networking sites for sport doping information used the site to check knowledge for sport doping from friends and relatives not from the specialists in this field, in that case the information in sport doping were not enough, so they were skeptical about the quality of information.','English'),(3831,128,23,'https://thesisleader.com/essays/doping-in-sports/','Negative Effects of Doping in Sports (essay sample ...','Unfortunately, the world of sports is very often related with the word doping, since respectful and famous athletes have been tested positive for banned pills and substances. Undoubtedly, the level of these ingredients is increased annually due to the desire to be the first no matter what.','English'),(3832,128,24,'https://www.youtube.com/watch?v=4rUpX3QSPmw','What Do Performance-Enhancing Drugs Do To Your Body?','The Olympics are upon us, and unfortunately, many athletes use performance enhancing drugs to boost their ability. What exactly does doping and steroids do to your body? Watch More: Check out ...','English'),(3833,128,25,'https://www.verywellfit.com/epo-and-blood-doping-in-sports-3120522','Erythropoietin (EPO) in Blood Doping in Sports - Verywell Fit','Blood doping is in violation of standards set by the World Anti-Doping Agency (WADA) and is banned in professional sports. Even with rigorous testing among athletes, that hasn\'t stopped some from doing it anyway.','English'),(3834,128,26,'https://sportsanddrugs.procon.org/view.resource.php?resourceID=002352','Top 10 Pro & Con Arguments - Drug Use in Sports - ProCon.org','Furthernore, legalisation of doping, we believe, would encourage more sensible, informed use of drugs in amateur sport, leading to an overall decline in the rate of health problems associated with doping. Finally, by allowing medically supervised doping, the drugs used could be assessed for a clearer view of what is dangerous and what is not...','English'),(3835,128,27,'https://addictionresource.com/drugs-in-sports/','Drugs in Sports: Statistics, Side Effects, Prevention ...','On August 26th, 1960, doping in sports became an international topic when Knut Jensen died during the Olympic games in Rome. His death was linked to the use of amphetamines. In 1967, after a high-profile Tour de France doping death, the International Olympic Committee established a commission to fight doping in sports.','English'),(3836,128,28,'https://sportsanddrugs.procon.org/view.timeline.php?timelineID=000017','Historical Timeline - Drug Use in Sports - ProCon.org','\"The use of drugs to enhance performance in sports has certainly occurred since the time of the original Olympic Games [from 776 to 393 BC]. The origin of the word \'doping\' is attributed to the Dutch word \'doop,\' which is a viscous opium juice, the drug of choice of the ancient Greeks.\"','English'),(3837,128,29,'https://www.livescience.com/55779-biggest-doping-scandals-in-olympics-history.html','10 Biggest Doping Scandals in Olympics History | Live Science','Live Science is supported by its audience. When you purchase through links on our site, we may earn an affiliate commission. Learn more 10 Biggest Doping Scandals in Olympics History','English'),(3838,129,0,'https://en.wikipedia.org/wiki/Human_cloning','Human cloning - Wikipedia','Human cloning is the creation of a genetically identical copy (or clone) of a human.The term is generally used to refer to artificial human cloning, which is the reproduction of human cells and tissue.It does not refer to the natural conception and delivery of identical twins.The possibility of human cloning has raised controversies.These ethical concerns have prompted several nations to pass ...','English'),(3839,129,1,'https://www.genome.gov/about-genomics/fact-sheets/Cloning-Fact-Sheet','Cloning Fact Sheet | NHGRI','The term cloning describes a number of different processes that can be used to produce genetically identical copies of a biological entity. The copied material, which has the same genetic makeup as the original, is referred to as a clone.','English'),(3840,129,2,'https://www.medicaldaily.com/science-human-cloning-how-far-weve-come-and-how-far-were-capable-going-340006','The Science Of Human Cloning: How Far We\'ve Come And How ...','The body of the world\'s first cloned sheep, Dolly, is now stuffed and on display at the Museum of Scotland Neil Turner CC BY-NC-ND 2.0. We Can Do It, But Is It Safe? It would be theoretically possible to clone humans, but, to date, there are no records of an actual fully developed human ever being cloned, Live Science reported. The closest we have come to this is the 1997 cloning of our closet ...','English'),(3841,129,3,'https://humancloning.org/','Human cloning','Human Cloning Ancestry Quality resources from cloning to DNA and ancestors','English'),(3842,129,4,'https://www.geneticsandsociety.org/topics/human-cloning','Human Cloning | Center for Genetics and Society','Gallup released its annual Values and Beliefs survey on June 4th. This is the 18th year in which Gallup has conducted its poll about the moral acceptability of various topics, including human cloning, animal cloning, and (since 2002) medical research using stem cells obtained from human embryos.','English'),(3843,129,5,'https://cbhd.org/content/human-cloning','Human Cloning | The Center for Bioethics & Human Dignity','We live in a brave new world in which reproductive technologies are ravaging as well as replenishing families. Increasingly common are variations of the situation in which \"baby\'s mother is also grandma-and sister.\"[1] Sometimes extreme measures are necessary in order to have the kind of child we want.','English'),(3844,129,6,'https://biologywise.com/human-cloning-pros-cons','Human Cloning: The Pros and Cons Highlight Its Risk','Human cloning is the practice of creating genetically identical copy/copies of a person, or cells and tissues of the person. The process is quite similar to the process in which identical twins are born.','English'),(3845,129,7,'https://futurism.com/human-cloning-whats-stopping','Ethical Implications of Human Cloning | Futurism','The technology for successful human cloning is within our reach. But the legal, ethical, and social implications keep us from using it.','English'),(3846,129,8,'https://www.healthline.com/health-news/research-for-human-cloning','How Close Are We to Cloning a Human? - health