on, in the corner of a Greenwich Village lamp shop, more than a half a million people have logged on to the Web site to exchange information. Women ...','English'),(3852,129,14,'https://science.howstuffworks.com/life/genetic/human-cloning.htm','How Human Cloning Will Work | HowStuffWorks','Human cloning has been an ethical issue ever since the first sheep was cloned in 1997. Learn about the science behind human cloning.','English'),(3853,129,15,'https://thenextgalaxy.com/12-disadvantages-and-advantages-of-human-cloning/','12 Disadvantages and Advantages of Human Cloning | Samsung ...','Human cloning is possibly one of the most heated and relevant ethical debates of our time. Cloning is the process of taking genetic material from one organism, and creating an identical copy of it by growing it artificially.','English'),(3854,129,16,'https://www.genome.gov/','National Human Genome Research Institute','About the National Human Genome Research Institute. At NHGRI, we are focused on advances in genomics research. Building on our leadership role in the initial sequencing of the human genome, we collaborate with the world\'s scientific and medical communities to enhance genomic technologies that accelerate breakthroughs and improve lives.','English'),(3855,129,17,'https://www.thoughtco.com/should-human-cloning-be-banned-721486','Should Human Cloning Be Banned? - ThoughtCo','Human cloning is illegal in some states, and institutions that receive U.S. federal funding are prohibited from experimenting with it, but there is no federal ban on human cloning in the United States.','English'),(3856,129,18,'http://www.cbc-network.org/issues/faking-life/human-cloning/','Human Cloning  The Center for Bioethics and Culture','Cited by Science magazine as the breakthrough of 1997, the worlds media flocked to cover the story of a cloned sheep named Dolly by scientists at Scotlands Roslin Institute. While scientists had been cloning animals since 1952, when a tadpole was cloned, the creati